    def test__pairwise_align(self):
        # first orf start/last orf end indexes (0-based) re UNgapped reference
        #          6                                       25
        # -ATTAA A GGTTT ATTCC ----- ----- ----- TTCCC AGGTA AC-AAGTAC
        # CATT-- A GGTTT ATACC AAAAA AANAA AAAAA TT-CC AGGTA ACTAA--AC
        #          5                                       38
        ref_align = "-ATTAAAGGTTTATACC---------------TTCCCAGGTAAC-AAGTAC"
        cons_align = "CATT--AGGTTTATTCCAAAAAAANAAAAAAATT-CCAGGTAACTAA--AC"
        readable_consensus = "CATTA GGTTT ATTCC AAAAA AANAA AAAAA TT CC " \
                             "AGGTA ACTAAAC"
        consensus_seq = readable_consensus.replace(" ", "")
        real_out = _pairwise_align((CONS_NAME, consensus_seq),
                                   (REF_NAME, REF_GENOME_SHORT),
                                   REF_SHORT_FIRST_ORF_START_1BASED,
                                   REF_SHORT_LAST_ORF_END_1BASED)

        self.assertEqual(REF_NAME, real_out[REF_SEQ_NAME])
        self.assertEqual(ref_align, real_out[REF_ALIGNMENT])
        self.assertEqual(CONS_NAME, real_out[CONS_SEQ_NAME])
        self.assertEqual(cons_align, real_out[CONS_ALIGNMENT])
        self.assertEqual(5, real_out[CONS_FIRST_ORF_START_0B])
        self.assertEqual(38, real_out[CONS_LAST_ORF_END_0B])
        self.assertEqual(15, real_out[NUM_INSERTS])
        self.assertEqual(1, real_out[NUM_DELS])

    def test__pairwise_align_no_insert(self):
        # 6 bases 5' utr, 20 bases of orfs, 8 bases 3' utr
        # 1 mismatch relative to reference, no insertions or deletions

        # first orf start/last orf end indexes (0-based) re UNgapped reference
        #       6                       25
        # ATTAA A GGTTT ATACC TTCCC AGGTA ACAAGTAC
        # ATTAA A GGTTT ATTCC GTCCC AGGTA ACAAGTAC
        #       6                       25

        readable_consensus = "ATTAA A GGTTT ATTCC GTCCC AGGTA ACAAGTAC"
        consensus_seq = readable_consensus.replace(" ", "")
        real_out = _pairwise_align(
            (CONS_NAME, consensus_seq), (REF_NAME, REF_GENOME_SHORT),
            REF_SHORT_FIRST_ORF_START_1BASED, REF_SHORT_LAST_ORF_END_1BASED)

        self.assertEqual(REF_NAME, real_out[REF_SEQ_NAME])
        self.assertEqual(REF_GENOME_SHORT, real_out[REF_ALIGNMENT])  # no gaps!
        self.assertEqual(CONS_NAME, real_out[CONS_SEQ_NAME])
        self.assertEqual(consensus_seq, real_out[CONS_ALIGNMENT])  # no gaps!
        self.assertEqual(REF_SHORT_FIRST_ORF_START_1BASED-1,
                         real_out[CONS_FIRST_ORF_START_0B])
        self.assertEqual(REF_SHORT_LAST_ORF_END_1BASED-1,
                         real_out[CONS_LAST_ORF_END_0B])
        self.assertEqual(0, real_out[NUM_INSERTS])
        self.assertEqual(0, real_out[NUM_DELS])

